import React, { useState, useEffect } from "react";
import {
  Container,
  TextField,
  Button,
  Typography,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Chip,
  Grid,
  Checkbox,
  FormControlLabel,
  Paper,
} from "@mui/material";
import { ToastContainer, toast } from "react-toastify";
import { motion } from "framer-motion"; // Framer Motion
import "react-toastify/dist/ReactToastify.css";

export default function StatusDebtor() {
  const [debts, setDebts] = useState([]);
  const [participant, setParticipant] = useState('');
  const [amountOwed, setAmountOwed] = useState('');

  useEffect(() => {
    const savedDebts = JSON.parse(localStorage.getItem('debts')) || [];
    setDebts(savedDebts);
  }, []);

  useEffect(() => {
    localStorage.setItem('debts', JSON.stringify(debts));
  }, [debts]);

  const addDebt = () => {
    if (!participant || !amountOwed || isNaN(amountOwed)) {
      toast.error('Please enter valid participant name and amount!');
      return;
    }

    const newDebt = { participant, amountOwed: parseFloat(amountOwed) };
    setDebts([...debts, newDebt]);
    setParticipant('');
    setAmountOwed('');
    toast.success('Debt added!');
  };

  const deleteDebt = (index) => {
    setDebts(debts.filter((_, i) => i !== index));
    toast.success('Debt removed!');
  };

  const payOffDebt = (index, amountPaid) => {
    setDebts(debts.map((debt, i) => 
      i === index 
        ? { ...debt, amountOwed: Math.max(debt.amountOwed - amountPaid, 0) } 
        : debt
    ));
    toast.success('Debt updated!');
  };

  const markPaid = (index) => {
    setDebts(debts.filter((_, i) => i !== index));
    toast.success('Debt fully paid!');
  };

  return (
    <Container>
      <Typography variant="h4" style={{ marginBottom: '20px', textAlign: 'center' }}>
        Status Debtor
      </Typography>

      <TextField
        label="Participant Name"
        value={participant}
        onChange={(e) => setParticipant(e.target.value)}
        fullWidth
        style={{ marginBottom: '10px' }}
      />
      <TextField
        label="Amount Owed"
        value={amountOwed}
        onChange={(e) => setAmountOwed(e.target.value)}
        fullWidth
        style={{ marginBottom: '10px' }}
      />
      <Button variant="contained" color="primary" onClick={addDebt}>
        Add Debt
      </Button>

      <TableContainer component={Paper} style={{ marginTop: '20px' }}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Participant</TableCell>
              <TableCell>Amount Owed (฿)</TableCell>
              <TableCell>Actions</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {debts.map((debt, index) => (
              <TableRow key={index}>
                <TableCell>{debt.participant}</TableCell>
                <TableCell>{debt.amountOwed.toFixed(2)} ฿</TableCell>
                <TableCell>
                  <Button
                    variant="contained"
                    color="secondary"
                    onClick={() => payOffDebt(index, prompt('Enter payment amount'))}
                    style={{ marginRight: '10px' }}
                  >
                    Pay Off
                  </Button>
                  <Button
                    variant="contained"
                    color="success"
                    onClick={() => markPaid(index)}
                  >
                    Mark as Paid
                  </Button>
                  <Button
                    variant="outlined"
                    color="error"
                    onClick={() => deleteDebt(index)}
                  >
                    Delete
                  </Button>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      <ToastContainer />
    </Container>
  );
}
